import React from 'react';

import './Burger.css';
import BurgerIngredient from '../Burger/BurgerIngredients/BurgerIngredient'

const burger = (props) => {
    const listOfIngredients = Object.keys(props.ingredients) 
        .map(ingredKey => {
            return [...Array(props.ingredients[ingredKey])].map((_, i => {
                return <BurgerIngredient key={ingredKey + i} type={ingredKey}/>
            }));
        });
    console.log('Burger Inicio:')
    console.log(BurgerIngredient);
    return (
        <div className='Burger'>
            <BurgerIngredient type="bread-top" />
                {listOfIngredients}
            <BurgerIngredient type="bread-bottom" />
        </div>
    );
};

export default burger;
